import { Link } from "react-router-dom";
import styled from "styled-components";
import {
  FaBars,
  FaSearch,
  FaShoppingBasket,
  FaUserCircle,
} from "react-icons/fa";
const color = "#0cc9c9";
export const ULElement = styled.ul`
  margin: 0;
  padding: 0;
  display: flex;
  list-style-type: none;
  position: relative;
`;

export const LIElement = styled.li`
  & {
    text-decoration: none;
    padding: ${(props) => (props.padding ? "0 100px" : "0 30px")};
  }
`;

export const LinkContainer = styled(Link)`
  text-decoration: none;
  font-size: 16px;
  font-weight: bold;
  font-family: "Fira Sans", sans-serif;
  color: ${(props) => (props.primary ? color : "black")};
  display: inline-block;
  &::after {
    content: "";
    width: 0px;
    height: 1px;
    display: block;
    background: black;
    transition: 300ms;
  }

  &:hover::after {
    width: 100%;
  }
`;

export const Menubar = function () {
  return (
    <ULElement>
      <LinkContainer primary to="admin/user">
        <LIElement>Home</LIElement>
      </LinkContainer>
      <LIElement>
        <LinkContainer to="">Pages</LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">Destinations</LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">Blog</LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">Shop</LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">Element</LinkContainer>
      </LIElement>
      <LIElement padding>
        <LinkContainer to="">
          <FaUserCircle />
        </LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">
          <FaShoppingBasket />
        </LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">
          <FaSearch />
        </LinkContainer>
      </LIElement>
      <LIElement>
        <LinkContainer to="">
          <FaBars />
        </LinkContainer>
      </LIElement>
    </ULElement>
  );
};
